  `lokasi` varchar(255) DEFAULT NULL,
  `sisa_pagu` decimal(18,2) DEFAULT NULL,
  `waktu_pelaksanaan` varchar(255) DEFAULT NULL,
  `kelompok_sasaran` varchar(255) DEFAULT NULL,
  `pagu_anggaran` decimal(18,2) NOT NULL DEFAULT 0.00,
  `keterangan` text DEFAULT NULL,
