#
# Structure for table "sub_kegiatan"
#

CREATE TABLE `sub_kegiatan` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `id_kegiatan` bigint(20) unsigned NOT NULL,
  `kode` varchar(50) NOT NULL,
  `nama` longtext NOT NULL,
  `id_pptk` bigint(20) unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sub_kegiatan_id_kegiatan_foreign` (`id_kegiatan`),
  CONSTRAINT `sub_kegiatan_id_kegiatan_foreign` FOREIGN KEY (`id_kegiatan`) REFERENCES `kegiatan` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1245 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

